import React from "react";
import { NavLink } from "react-router-dom";
import {
  FaCalculator,
  FaHistory,
  FaUser,
  FaUsers,
  FaSignOutAlt,
} from "react-icons/fa";

export default function BottomNav({ role, onLogout }) {
  return (
    <nav className="bottom-nav">
      <NavLink to="/calculator">
        <FaCalculator />
        <div>Калькулятор</div>
      </NavLink>

      <NavLink to="/history">
        <FaHistory />
        <div>История</div>
      </NavLink>

      <NavLink to="/profile">
        <FaUser />
        <div>Профиль</div>
      </NavLink>

      {role === "doctor" && (
        <NavLink to="/patients">
          <FaUsers />
          <div>Пациенты</div>
        </NavLink>
      )}

      <button onClick={onLogout} style={{ background: "none", border: "none" }}>
        <FaSignOutAlt color="#ef4444" />
      </button>
    </nav>
  );
}
